import React, { Component } from 'react';
import { NavLink } from "react-router-dom";

class Nav extends Component {
  render() {
    return (
     <div  className="list-group" id="" role="">
      <NavLink className="list-group-item list-group-item-action text-center" role="tab" aria-controls="home">Home</NavLink>
     
    
    </div>
    );
  }
}

export default Nav;
